# Rassvet, Republic of Dagestan

}}
Rassvet () is a rural locality (a selo) and the administrative center of Ullubiyevsky Selsoviet, Tarumovsky District, Republic of Dagestan, Russia. Population:  There are 4 streets.
Geography
Rassvet is located 22&nbsp;km southeast of Tarumovka (the district's administrative centre) by road. Komsomolsky is the nearest rural locality.
